import styled from 'styled-components'

export const ToplistWrapper = styled.div`
  margin-top: 35px;

  .toplist-content {
    display: flex;
    background: url(${require('@/assets/img/recommend-top-bg.png')});

    .toplist {
      background-color: orange;
    }
  }

`
